import ReactTable from 'react-table-6'
import * as React from "react";


class TransactionComponent extends React.Component {



    render() {

        let tx = this.props.data[0].hash
        console.log(tx)


        const tx1 = [{
            hash: this.props.data[0].hash,
            age: Date.now() - this.props.data[0].timestamp,
            from: this.props.data[0].from,
            to: this.props.data[0].to,
            gasUsed: this.props.data[0].gasUsed,
        },]

        const tx2 = [{
            hash: this.props.data[1].hash,
            age: Date.now() - this.props.data[1].timestamp,
            from: this.props.data[1].from,
            to: this.props.data[1].to,
            gasUsed: this.props.data[1].gasUsed,
        },]

        const columns = [{
            Header: 'Хэш транзакции',
            accessor: 'hash' // String-based value accessors!
        }, {
            Header: 'Age',
            accessor: 'age',
        }, {
            Header: 'From',
            accessor: 'from'
        }, {
            Header: 'To',
            accessor: 'to'
        }, {
            Header: 'GasUsed',
            accessor: 'gasUsed'
        }
        ]

        return <ReactTable
            data={tx1}
            data2={tx2}
            columns={columns}
        />
    }
}

export default TransactionComponent
